function parseBankAccounts(){let n=[];return $("#view_45 .kn-list-content .kn-list-item-container, #view_69 .kn-list-content .kn-list-item-container").each(function(){let a={};$(this).find(".kn-detail").each(function(){let n=$(this).find(".kn-detail-label span span").text(),t=n.split(" ").join(""),c=$(this).find(".kn-detail-body span span").text();if("AccountBank"===t&&(c=$(this).find(".kn-detail-body span span span").text()),"BankLogo"===t){let n=$(this).find(".kn-detail-body span span span img");c=$(n).attr("src")}a[t]={label:n,value:c}}),n.push(a)}),n}function creatBankAccountList(){let n=parseBankAccounts(),a="";n.forEach((n,t)=>{let c=`\n            <div class="bank-account-item bordered">\n                <img src="${n.BankLogo.value}" alt="bank account logo" width="56" height="56" class="img-bank" />\n            \n                <div class="bci-content">\n                    <span class="bci-bank-name">${n.AccountBank.value}</span>\n                    <span class="bci-account">${n.AccountNumber.value}</span>\n                </div>\n            </div>\n        `;a+=c});let t=`\n        <div class="main-accounts-container">\n            <div class="accounts-header">\n                <span class="ah-title">Linked Accounts</span>\n            </div>\n\n            ${a}\n        </div>\n    `;$(".bank-accounts-container").append(t)}function loadHomeView(){creatBankAccountList()}